import {Image} from "./components/Image/image";

function App() {
  return (
    <div className="App">

      <header className="App-header">
        {/*<img src={logo} className="App-logo" alt="logo" />*/}
        <p>
            coś tu trzeba wyświetlić
        </p>
          <Image/>
